modules.original_code:
module three_input_and_gate(
    input A,
    input B,
    input C,
    output out
);

assign out = A & B & C;

endmodule

modules.masked_code:
module three_input_and_gate_masked(
    input A0,
    input A1,
    input B0,
    input B1,
    input C0,
    input C1,
    input rN,
    output out0,
    output out1
);

wire p00, p01, p10, p11;
wire p20, p21, p30, p31;

assign p00 = A0 & B0;
assign p01 = A0 & B1;
assign p10 = A1 & B0;
assign p11 = A1 & B1;

assign p20 = p00 & C0;
assign p21 = p01 & C0;
assign p30 = p10 & C0;
assign p31 = p11 & C0;

assign out0 = p20 ^ p21 ^ rN;
assign out1 = p30 ^ p31 ^ rN;

endmodule
